const quoteList = [
  {id: "1", author: "author1", text: "hi"},
  {id: "2", author: "author2", text: "hi"},
  {id: "3", author: "author3", text: "3333333"}

]

  return (
  <>
  <Card>
  <QuoteList quotes={quoteList}/>
  </Card>

  </>)

}

export default AllQuotes
